def solution():
    prime_factors_count = 144 // 2  # For any n, the number of divisors is the product of (exponent + 1) for its prime factorization
    primes = []
    exponent = 1
    # Generate prime factors with exponents, starting with the smallest primes
    while len(primes) < prime_factors_count:
        primes.append(exponent)
        exponent = nextprime(exponent)

    # Start from the highest exponent, decrease each by 1 in turn until we find 10 consecutive numbers
    n = 1
    while True:
        # Build the number n from the prime factors and their exponents
        n = 1
        for i, prime in enumerate(primes):
            n *= (prime ** (i + 1))
        # Check for 10 consecutive factors
        factors = divisors(n)
        for i in range(len(factors) - 9):
            if factors[i + 9] - factors[i] == 9:
                return n
        # If no 10 consecutive factors, decrease the last non-one exponent by 1
        for i in range(len(primes) - 1, -1, -1):
            if primes[i] > 2:
                primes[i] -= 1
                for j in range(i + 1, len(primes)):
                    primes[j] = primes[j - 1]
                break

