from sympy import isprime, factorint

def reverse_num(num):
    return int(str(num)[::-1])

def sum_of_digits(num):
    return sum(int(digit) for digit in str(num))

def remove_zeros(num):
    return int(str(num).replace('0', ''))

def sum_of_squares_of_prime_factors(num):
    factors = factorint(num)
    return sum((p**2 * factors[p]) // 2 for p in factors)

def satisfies_condition(n):
    s_n = sum_of_digits(n)
    reversed_s_n = reverse_num(s_n)
    return n == s_n * reversed_s_n

def satisfies_prime_factors_condition(n):
    reversed_n = reverse_num(n)
    sum_of_squares = sum_of_squares_of_prime_factors(reversed_n)
    no_zeros = remove_zeros(sum_of_squares)
    return n == no_zeros

def solution():
    n = 1
    while True:
        if isprime(n) and satisfies_condition(n) and satisfies_prime_factors_condition(n):
            return n
        n += 1

