    rocks = [8.5, 6, 4, 4, 3, 2]
    total_weight = sum(rocks)
    min_heaviest = total_weight

    # Iterate over all possible combinations of rocks in the first backpack
    for i in range(1, len(rocks)):
        for first_pack in combinations(rocks, i):
            remaining_rocks = rocks.copy()
            for rock in first_pack:
                remaining_rocks.remove(rock)

            # Iterate over all possible combinations of rocks in the second backpack, with the remaining rocks
            for j in range(1, len(remaining_rocks)):
                for second_pack in combinations(remaining_rocks, j):
                    third_pack = remaining_rocks.copy()
                    for rock in second_pack:
                        third_pack.remove(rock)

                    heaviest_pack = max(sum(first_pack), sum(second_pack), sum(third_pack))
                    min_heaviest = min(min_heaviest, heaviest_pack)

    return min_heaviest

