    from itertools import combinations

    # Original set
    full_set = {'a1', 'a2', 'a3', 'a4', 'a5'}
    subset_count = {}

    # Calculate number of combinations for each possible size of subset
    for i in range(1, 6):
        subset_count[i] = len(list(combinations(full_set, i)))

    # Calculate number of valid ordered pairs (A, B) such that neither is a subset of the other
    ans = 0
    for size_a in range(1, 6):
        for size_b in range(1, 6):
            if size_a == size_b:
                # When subsets A and B are of the same size, they can't be subsets of each other
                ans += subset_count[size_a] * subset_count[size_b] - subset_count[size_a]
