    for guess, (correct_place, wrong_place) in zip(guesses, hints):
        for i, digit in enumerate(guess):
            if correct_place:
                # If the digit is in the correct place, remove it from others
                if guesses[2][i] == digit:
                    possible_values[i].clear()
                    possible_values[i].add(digit)
