from math import factorial

def count_permutations(elements_dict, sequence_length):
    def helper(counter, length):
        if length == 0:
            return factorial(sum(counter.values())) // \
                   (factorial(counter['A']) * factorial(counter['I']) * \
                    factorial(counter['M']) * factorial(counter['E']) * \
                    factorial(counter['2']) * factorial(counter['0']) * \
                    factorial(counter['7']))
        else:
            total = 0
            for symbol in counter:
                if counter[symbol] > 0:
                    counter[symbol] -= 1
                    total += helper(counter.copy(), length - 1)
                    counter[symbol] += 1
            return total

    return helper(elements_dict, sequence_length)

def solution():
    elements = {'A': 1, 'I': 1, 'M': 1, 'E': 1, '2': 1, '0': 2, '7': 1}
    N = count_permutations(elements, 5)
    return N // 10

