from sympy import primerange, isprime

def solution():
    # The sum of 77 consecutive integers can be written as n+(n+1)+...+(n+76) = 77n + 76*77/2
    # Let the first integer be n. Then the sum is 77n + 2916.
    # So, a * b * c * d = 77n + 2916. We will find the minimum value of a+b+c+d.
    # We will first check within certain bounds until we find a prime number decomposition
    # the minimum value of n can't be less than 1 
    # the maximum value of n can't exceed 77n since the sum can't exceed 4 prime numbers multiplied
    min_sum = float('inf')
    for n in range(1, 2920):
        product = 77 * n + 2916
        primes = list(primerange(2, product+1))
        for a in primes:
            if product % a == 0:
                for b in primes:
                    if product % (a * b) == 0:
                        for c in primes:
                            if product % (a * b * c) == 0:
                                d = product // (a * b * c)
                                if isprime(d):
                                    current_sum = a + b + c + d
                                    if current_sum < min_sum:
                                        min_sum = current_sum
    return min_sum

ans = solution()

