    # we know it must be divisible by the least common multiple (LCM) of 
    # a subset of those numbers. We can start by finding the LCM of all 20 numbers.

    from math import gcd

    # Function to calculate LCM of two numbers
    def lcm(a, b):
        return a * b // gcd(a, b)

    # Calculate the LCM of the first 20 natural numbers
    lcm_20 = 1
    for i in range(1, 21):
        lcm_20 = lcm(lcm_20, i)

    # N must be some multiple of lcm_20 without the factors of two consecutive natural numbers.
    # We will start with the highest pair (19, 20) and go down to the lower pairs.
    # Since the LCM is divisible by all numbers from 1 to 20, if N misses two factors,
    # they must be prime or have no common divisors with other numbers in the set.
    for x in range(19, 1, -1):
        if gcd(x, x + 1) == 1 and lcm_20 % x != 0 and lcm_20 % (x + 1) != 0:
            # Since N is not divisible by x and x+1, and they are prime,
            # they are the consecutive numbers we are looking for.
            return x + (x + 1)

    return -1  # If the loop completes without finding a pair, return an error code

