    # Loop through all possible values of the minuend and subtrahend
    # Considering the swapped numbers, the minuend's hundreds digit is less than 10
    for minuend in range(100, 1000):
        for subtrahend in range(100, minuend):
            if minuend - subtrahend == difference:
                # Swap hundreds and tens places for both numbers
                minuend_swapped = int(str(minuend)[-1] + str(minuend)[1] + str(minuend)[0])
                subtrahend_swapped = int(str(subtrahend)[-1] + str(subtrahend)[1] + str(subtrahend)[0])
                # Check if the swapped minuend is 1.2 times the swapped subtrahend
                if minuend_swapped == 1.2 * subtrahend_swapped:
                    return minuend
    return None

ans = solution()

